import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1><a className='Player-Name'>Spotify Webplayer</a></h1>
        <video id='video' controls autoPlay>Could not locate file</video>
      </header>
    </div>
  );
}

export default App;
